"original": |2-
     o  'spool-area-full': The limit of persistent storage allocated for
        spooling has been reached.  The Printer is temporarily unable to
        accept more Jobs.  The Printer will remove this value when it is
        able to accept more Jobs.  This value SHOULD be used by a
        non-spooling Printer that only accepts one or a small number of
        Jobs at a time or by a spooling Printer that has filled the spool
        space.
"fixed": |-
  -  'spool-area-full': The limit of persistent storage allocated for spooling has been reached.  The Printer is temporarily unable to accept more Jobs.  The Printer will remove this value when it is able to accept more Jobs.  This value SHOULD be used by a non-spooling Printer that only accepts one or a small number of Jobs at a time or by a spooling Printer that has filled the spool space.
"ko": |-
  - 'spool-area-full': 스풀링에 할당된 영구 스토리지 한도에 도달했습니다. 프린터가 일시적으로 더 많은 작업을 수용할 수 없습니다. 프린터는 더 많은 작업을 수용할 수 있게 되면 이 값을 제거합니다. 이 값은 한 번에 하나 또는 적은 수의 작업만 허용하는 비스풀링 프린터 또는 스풀 공간을 채운 스풀링 프린터에서 사용해야 합니다.
